import sys
import os
import os.path
import subprocess
import hashlib
import base64
from io import BytesIO
import tkinter as tk
import tkinter.ttk as ttk
from PIL import ImageTk, Image
from tkinter import messagebox

script_dir = os.path.dirname(os.path.realpath(sys.argv[0]))

bin_dir = os.path.join(script_dir, "bin")

adb_path = os.path.join(script_dir, "bin", "adb.exe")
xrshell_path = os.path.join(script_dir, "bin", "OpenXR", "1.apk")
xrruntime_path = os.path.join(script_dir, "bin", "OpenXR", "2.apk")
mrservice_path = os.path.join(script_dir, "bin", "OpenXR", "3.apk")
seethr_path = os.path.join(script_dir, "bin", "OpenXR", "4.apk")
guardian_path = os.path.join(script_dir, "bin", "OpenXR", "5.apk")

def install():
    try:
        subprocess.run([adb_path, "install", xrshell_path], stderr=subprocess.STDOUT, creationflags=subprocess.CREATE_NO_WINDOW, text=True)
        subprocess.run([adb_path, "install", xrruntime_path], stderr=subprocess.STDOUT, creationflags=subprocess.CREATE_NO_WINDOW, text=True)
        subprocess.run([adb_path, "install", mrservice_path], stderr=subprocess.STDOUT, creationflags=subprocess.CREATE_NO_WINDOW, text=True)
        subprocess.run([adb_path, "install", seethr_path], stderr=subprocess.STDOUT, creationflags=subprocess.CREATE_NO_WINDOW, text=True)
        subprocess.run([adb_path, "install", guardian_path], stderr=subprocess.STDOUT, creationflags=subprocess.CREATE_NO_WINDOW, text=True)
        subprocess.run([adb_path, "reboot"], stderr=subprocess.STDOUT, creationflags=subprocess.CREATE_NO_WINDOW, text=True)
        messagebox.showinfo("Success", "OpenXR_Fix successfully installed")
    except Exception as e:
        print(f"Fehler: {e}")

def uninstall():
    try:
        subprocess.run([adb_path, "uninstall", "com.picoxr.xrshell"], stderr=subprocess.STDOUT, creationflags=subprocess.CREATE_NO_WINDOW, text=True)
        subprocess.run([adb_path, "uninstall", "com.pico.xr.openxr_runtime"], stderr=subprocess.STDOUT, creationflags=subprocess.CREATE_NO_WINDOW, text=True)
        subprocess.run([adb_path, "uninstall", "com.pico.mrservice"], stderr=subprocess.STDOUT, creationflags=subprocess.CREATE_NO_WINDOW, text=True)
        subprocess.run([adb_path, "uninstall", "com.pvr.seethrough.setting"], stderr=subprocess.STDOUT, creationflags=subprocess.CREATE_NO_WINDOW, text=True)
        subprocess.run([adb_path, "uninstall", "com.pico.guardian"], stderr=subprocess.STDOUT, creationflags=subprocess.CREATE_NO_WINDOW, text=True)
        subprocess.run([adb_path, "reboot"], stderr=subprocess.STDOUT, creationflags=subprocess.CREATE_NO_WINDOW, text=True)
        messagebox.showinfo("Success", "OpenXR_Fix successfully uninstalled")
    except Exception as e:
        print(f"Fehler: {e}")

def create_gui():
    window = tk.Tk()
    window.title("OpenXR Fixer - Made by FallenAngel / PicoPiracy Team")
    window.geometry("300x300") 

    top_frame = tk.Frame(window)
    top_frame.pack(side="top", pady=10)

    middle_frame = tk.Frame(window)
    middle_frame.pack(side="top", pady=10)

    bottom_frame = tk.Frame(window)
    bottom_frame.pack(side="top", pady=10)

    image_base64 = ""

    image_data = base64.b64decode(image_base64)

    image = Image.open(BytesIO(image_data))

    width = 100 
    height = 100
    image = image.resize((width, height))

    photo = ImageTk.PhotoImage(image)

    image_label = tk.Label(top_frame, image=photo)
    image_label.pack()

    start_button = tk.Button(middle_frame, text="Install", command=install)
    start_button.pack(side="left", padx=10)

    end_button = tk.Button(bottom_frame, text="Uninstall", command=uninstall)
    end_button.pack(side="left", padx=10)

    window.mainloop()

create_gui()